  };

  render() {
    return (
      <Layout>
        <link href="https://api.mapbox.com/mapbox-gl-js/v0.51.0/mapbox-gl.css" rel="stylesheet" />
        <Sider trigger={null} collapsible collapsed={this.state.collapsed}>
          <div className="logo" />
          <Menu theme="dark" mode="inline"
          selectedKeys={[this.state.sele]}
          onSelect={(s)=>{
            console.log(s.key)
          }}
          style={{height:"100vh"}}>
            <Menu.Item key="1">
              <div onClick={()=>this.changeSelection("1")}>
              <Icon type="dashboard" />
              <span> My Dashboard </span>
              </div>
            </Menu.Item>
            <Menu.Item key="2">
              <div onClick={()=>this.changeSelection("2")}>
              <Icon type="bar-chart" />
              <span> Query </span>
                </div>
            </Menu.Item>
            <Menu.Item key="3">
              <Icon type="eye" />
              <span> Search </span>
            </Menu.Item>
            <Menu.Item key="4">
              <Icon type="file-pdf" />
              <span> Reports </span>
            </Menu.Item>
            <Menu.Item key="5">
              <Icon type="team" />
              <span> Support </span>
            </Menu.Item>
          </Menu>
        </Sider>
        <Layout>
          <Header style={{ background: '#fff', paddingLeft: "20px" }}>
            <Icon
              className="trigger"
              type={this.state.collapsed ? 'menu-unfold' : 'menu-fold'}
              onClick={this.toggle}
            />
            <span style={{fontSize: "20px", marginLeft: "1%"}}> Patitent Insight Engine </span>

          </Header>
          <Content
            style={{
              margin: '24px 16px',
              padding: 24,
              background: '#fff',
              minHeight: 280,
            }}
          >
            {this.props.content}
          </Content>
        </Layout>
      </Layout>
    );
  }
}

export default SiderDemo
